const Lordicon = (iconName) => {
  const iconHref = `https://cdn.lordicon.com/${iconName}.json`;
  return (
    <lord-icon
      src="https://cdn.lordicon.com/rmkahxvq.json"
      trigger="hover"
      colors="primary:#e5e7eb"
    ></lord-icon>
  );
};

export default Lordicon;
